import React from 'react';
import '../styles/documentos.css';

const Licencias = () => {
    return (
        <div className="fondo">
            <div className="container pb-3">
                <h1 className="text-center mb-0 py-5">Licencias Digitales</h1>
            </div>
        </div>
    );
};

export default Licencias;
